measurements.description:
Seventeen flowers and five buds on four up to 24-cm strongly arching inflorescences;
	 flower cream overlaid pale green, heavy burgundy spots on reverse; 
	 petals lanceolate, slightly rolled, outer margin deep burgundy spotting;
	lip side lobes striped burgundy, midlobe overlaid burgundy spots coalesing to stripes, keel pale green;
	column pale green, anther cap white;	


    substance average; texture matte.
